INSERT INTO `wp_commentmeta` VALUES (198802, 69763, 'akismet_as_submitted', 'a:57:{s:15:"comment_post_ID";s:5:"19966";s:14:"comment_author";s:12:"Sophia Abbot";s:20:"comment_author_email";s:19:"sabbot@brynmawr.edu";s:18:"comment_author_url";s:0:"";s:15:"comment_content";s:655:"For much of this year, I\'ve been impressed over and over again at the incredible journalism happening at the Spectator. As an alumna, it makes me proud to know that the students of Stuyvesant are pushing harder and harder on the administration through investigative journalism, op-eds, and humor pieces. This piece, however, left me incredibly disappointed. As someone who has personally faced sexual harassment, I know that it is never a laughing matter. The perpetuation of rape culture and homophobia has got to end and this kind of humor works exactly against that. I sincerely hope the Spectator editors will address this and do better in the future.";s:12:"comment_type";s:0:"";s:14:"comment_parent";s:1:"0";s:7:"user_ID";s:1:"0";s:7:"user_ip";s:14:"165.106.130.26";s:10:"user_agent";s:117:"Mozilla/5.0 (Macintosh; Intel Mac OS X 10_6_8) AppleWebKit/534.57.2 (KHTML, like Gecko) Version/5.1.7 Safari/534.57.2";s:8:"referrer";s:112:"http://stuyspectator.com/2013/04/01/stuyvesant-student-body-expresses-jealousy-in-wake-of-bronx-science-scandal/";s:4:"blog";s:24:"http://stuyspectator.com";s:9:"blog_lang";s:5:"en_US";s:12:"blog_charset";s:5:"UTF-8";s:9:"permalink";s:112:"http://stuyspectator.com/2013/04/01/stuyvesant-student-body-expresses-jealousy-in-wake-of-bronx-science-scandal/";s:21:"akismet_comment_nonce";s:6:"passed";s:11:"POST_author";s:12:"Sophia Abbot";s:10:"POST_email";s:19:"sabbot@brynmawr.edu";s:8:"POST_url";s:0:"";s:12:"POST_comment";s:655:"For much of this year, I\'ve been impressed over and over again at the incredible journalism happening at the Spectator. As an alumna, it makes me proud to know that the students of Stuyvesant are pushing harder and harder on the administration through investigative journalism, op-eds, and humor pieces. This piece, however, left me incredibly disappointed. As someone who has personally faced sexual harassment, I know that it is never a laughing matter. The perpetuation of rape culture and homophobia has got to end and this kind of humor works exactly against that. I sincerely hope the Spectator editors will address this and do better in the future.";s:11:"POST_submit";s:14:"Submit Comment";s:20:"POST_comment_post_ID";s:5:"19966";s:19:"POST_comment_parent";s:1:"0";s:26:"POST_akismet_comment_nonce";s:10:"7ac49bc0fa";s:15:"SERVER_SOFTWARE";s:9:"LiteSpeed";s:11:"REQUEST_URI";s:21:"/wp-comments-post.php";s:11:"HTTP_ACCEPT";s:63:"text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8";s:20:"HTTP_ACCEPT_ENCODING";s:13:"gzip, deflate";s:20:"HTTP_ACCEPT_LANGUAGE";s:5:"en-us";s:15:"HTTP_CONNECTION";s:10:"keep-alive";s:12:"CONTENT_TYPE";s:33:"application/x-www-form-urlencoded";s:14:"CONTENT_LENGTH";s:3:"826";s:11:"HTTP_COOKIE";s:0:"";s:9:"HTTP_HOST";s:17:"stuyspectator.com";s:12:"HTTP_REFERER";s:112:"http://stuyspectator.com/2013/04/01/stuyvesant-student-body-expresses-jealousy-in-wake-of-bronx-science-scandal/";s:15:"HTTP_USER_AGENT";s:117:"Mozilla/5.0 (Macintosh; Intel Mac OS X 10_6_8) AppleWebKit/534.57.2 (KHTML, like Gecko) Version/5.1.7 Safari/534.57.2";s:11:"HTTP_ORIGIN";s:24:"http://stuyspectator.com";s:13:"DOCUMENT_ROOT";s:26:"/home/stuyspec/public_html";s:11:"REMOTE_ADDR";s:14:"165.106.130.26";s:11:"REMOTE_PORT";s:5:"55924";s:11:"SERVER_ADDR";s:14:"199.189.248.96";s:11:"SERVER_NAME";s:17:"stuyspectator.com";s:12:"SERVER_ADMIN";s:27:"webmaster@stuyspectator.com";s:11:"SERVER_PORT";s:2:"80";s:15:"REDIRECT_STATUS";s:3:"200";s:15:"SCRIPT_FILENAME";s:47:"/home/stuyspec/public_html/wp-comments-post.php";s:12:"QUERY_STRING";s:0:"";s:10:"SCRIPT_URI";s:45:"http://stuyspectator.com/wp-comments-post.php";s:10:"SCRIPT_URL";s:21:"/wp-comments-post.php";s:11:"SCRIPT_NAME";s:21:"/wp-comments-post.php";s:15:"SERVER_PROTOCOL