nce, the child experiences the unique integration of mind and body. Experts agree that music can strengthen children\'s minds and serve as a fundamental skill of learning. Music can help a child\'s creativity and their capacity to learn more. It also helps them get ready for understanding new concepts, like math. Music and songs help kids transition from one activity to another. Not only can music be used to manage behavior, but it can also be used to give kids an outlet for conflict or frustration or sadness. Music is an art form. We are emotional beings and every child requires an artistic outlet. Music may be your child\'s vehicle of expression. Music calms them, gets them excited, makes them sing, and gets them to make decisions while increasing their cognitive ability. Music making provides a positive outlet for young people to express negative feelings such as anger. Parents should provide some music knowledge for kids from the beginning itself. We can also provide some music software for kids such as FlexiMusic Kids Composer to enrich their music creativity.\r\n\r\nFinally, music can help children with delays or disabilities. Speech disabilities, a lot of therapists use music. Sometimes you have adults who can sing a song, but when they\'re talking they have a stuttering problem. It really helps with kids with speech disabilities. Or children that are in wheel chairs, music is a great outlet and very pleasurable for them.";s:12:"comment_type";s:0:"";s:14:"comment_parent";s:1:"0";s:7:"user_ID";s:1:"0";s:7:"user_ip";s:13:"58.62.139.115";s:10:"user_agent";s:57:"Opera/9.80 (Windows NT 5.1) Presto/2.12.388 Version/12.11";s:8:"referrer";s:87:"http://stuyspectator.com/2013/03/07/sing-2013-scoreboard/comment-page-1/#comment-67600/";s:4:"blog";s:24:"http://stuyspectator.com";s:9:"blog_lang";s:5:"en_US";s:12:"blog_charset";s:5:"UTF-8";s:9:"permalink";s:57:"http://stuyspectator.com/2013/03/07/sing-2013-scoreboard/";s:21:"akismet_comment_nonce";s:6:"passed";s:11:"POST_au